import React from 'react';
import { GluestackUIProvider, Box, VStack, View } from '@gluestack-ui/themed';
import { config } from '@gluestack-ui/config';
import { NavigationContainer } from '@react-navigation/native';
import { useNavigation } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { DrawerContent, DrawerItem, createDrawerNavigator } from '@react-navigation/drawer';
import categorias from './components/categorias';




function HomeScreen() {
  const navigation = useNavigation();
  return <View style={{
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center'

  }}></View>
}

const Drawer = createDrawerNavigator();

const Mycomponent =()=>(
<DrawerItem label={"first item"} onPress={function (): void {
    throw new Error('Function not implemented.');
  } }/>

)
export default function App() {

  return( 

  <NavigationContainer>
  <GluestackUIProvider config={config}>

  <Drawer.Navigator initialRouteName="Home">

        <Drawer.Screen name="Inicio" component={categorias}/>
        <Drawer.Screen name="Configuracion" component={HomeScreen}/> 

      </Drawer.Navigator>



</GluestackUIProvider>
</NavigationContainer>);


};
